script: |
  super -f text -I q7616.spq | sort > q7616.out

inputs:
  - name: q7616.spq
    data: |
      SELECT col0 * + tab0.col2 FROM tab0 (FORMAT parquet) WHERE NOT - col1 / col0 + col0 = ( col2 + - col0 ) AND col0 * col0 IN ( + col0 * - col1 );
  - name: tab0

outputs:
  - name: q7616.out
    data: |
